	private String normMixedValue(String text) {
	
		String mixedValue = text.toLowerCase().replaceAll("", "-").replaceAll("", "-").replaceAll("_", "-");
		
		mixedValue = text.replaceAll(" ", "").replaceAll("/", "-");
				
		return mixedValue;
	}


